import React from "react";
import "./item.css"

export default function PostItem(props){
        const post = props.post;
        return (
            <div onClick={()=>{props.delete(props.id)}}>
                <input value={post.title}/>
                <input value={post.text}/>
                <div>
                    <div>
                        Update
                    </div>
                    <div>
                        Delete
                    </div>
                </div>
            </div>
        );
}
